import React, { useState } from "react";
import Button from "./components/UI/Button";

import "./App.css";

const App = () => {
  return (
    <div>
      <Button>5%</Button>
      <Button>10%</Button>
      <Button className={"active"}>15%</Button>
      <Button>25%</Button>
      <Button>50%</Button>
    </div>
  );
};

export default App;
